import React, { useState } from "react";
function Form() {
  const [name, setName] = useState("");
  const [age, setAge] = useState("");
  return (
    <form>
        <label>
            Name:
      <input
        value={name}
        onChange={e => setName(e.target.value)}
        placeholder="Name"
        type="text"
        name="name"
        required
      />
      </label>
      <label>
          Age:
      <select 
        value={this.state.selectValue} 
        onChange={this.handleChange} 
      >
       <option value="Orange">18-24</option>
        <option value="Radish">25-34</option>
        <option value="Cherry">35-44</option>
        <option value="Cherry">45-54</option>
        <option value="Cherry">55-64</option>
      </select>
      </label>
      <button type="submit">Submit</button>
    </form>
  );
}
export default Form;
